import{_ as t,p as d,q as o,a1 as a}from"./framework-7e09d608.js";const r={},e=a('<h1 id="vagrant常用命令" tabindex="-1"><a class="header-anchor" href="#vagrant常用命令" aria-hidden="true">#</a> Vagrant常用命令</h1><table><thead><tr><th>命令</th><th>简单说明</th></tr></thead><tbody><tr><td><code>vagrant init [options] [name [url]]</code></td><td>初始化box的操作</td></tr><tr><td><code>vagrant up [options] [name or id]</code></td><td>启动虚拟机的操作</td></tr><tr><td><code>vagrant ssh [options] [name or id] [-- extra ssh args]</code></td><td>登录虚拟机的操作</td></tr><tr><td><code>vagrant box add [options] &lt;name, url, or path&gt;</code></td><td>添加box的操作</td></tr><tr><td><code>vagrant box remove &lt;name&gt;</code></td><td>删除某个box</td></tr><tr><td><code>vagrant box list</code></td><td>查看box列表</td></tr><tr><td><code>vagrant box remove</code></td><td>删除相应的box</td></tr><tr><td><code>vagrant destroy [options] [name or id]</code></td><td>停止当前正在运行的虚拟机并销毁所有创建的资源</td></tr><tr><td><code>vagrant halt [options] [name or id]</code></td><td>关闭虚拟机</td></tr><tr><td><code>vagrant package [options] [name or id]</code></td><td>打包命令，可以把当前的运行的虚拟机环境进行打包</td></tr><tr><td><code>vagrant reload [vm-name]</code></td><td>重新启动虚拟机，主要用于重新载入配置文件</td></tr><tr><td><code>vagrant suspend [name or id]</code></td><td>挂起当前虚拟机</td></tr><tr><td><code>vagrant resume [vm-name]</code></td><td>恢复被挂起的状态</td></tr><tr><td><code>vagrant ssh-config [options] [name or id]</code></td><td>输出用于ssh连接的一些信息</td></tr><tr><td><code>vagrant status [name or id]</code></td><td>获取当前虚拟机的状态</td></tr></tbody></table>',2),n=[e];function c(s,i){return d(),o("div",null,n)}const g=t(r,[["render",c],["__file","vagrant-common-commands.html.vue"]]);export{g as default};
